class Solution {
    func minimumOperations(_ num: String) -> Int {
        let candidates = ["00", "25", "50", "75"]
        var result = Int.max
        for candidate in candidates {
            var i = num.count - 1
            var steps = 0
            for c in candidate.reversed() {
                while i >= 0 && num[num.index(num.startIndex, offsetBy: i)] != c {
                    i -= 1
                    steps += 1
                }
                if i >= 0 { i -= 1 } else { break }
            }
            if i >= -1 { // -1 when candidate is found at the beginning of num
                result = min(result, steps + i + 1) // +1 because i starts from 0
            }
        }
        return result == Int.max ? num.count : result
    }
}
